css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url(http://www.bing.com/), 
url-prefix(http://www.bing.com/?scope=web){


/* Visual changes */

body {background: none #FFF !important;}
.content_wrap {background: transparent !important; border: none !important;}
.sw_b {padding: 0 !important; border: none !important; background-color: transparent !important;}
#sb_form_q {border: 1px solid !important; margin-right: 2px !important;}


/* center */

#sw_content {

background: none transparent !important;
display: table !important;
margin: 0 auto !important;}

.sw_sform
{display: table-cell !important; 
vertical-align: middle !important;
position: static !important;}

.search_controls {margin-top: -15% !important}

/* Remove - logo, page background image, tooltip, section links, image arrows, bottom page content */

.sw_logo,
#bgDiv,
#bgDiv ~ [style],
#sw_pb,
#sh_rdiv,
.sc_exp

 {display: none !important;}

/* New Bing logo */

#content {background: url(data:image/png;base64,) 50% 20% no-repeat !important;

border: none !important;}

}
